import React from 'react';

function LoginPage() {
  return (
    // <div>
    //   LoginPage
    // </div>
    <div>
      <h1>Username:</h1>
      <label>
        <h1>Username:</h1>
        <input className='input' type='text' placeholder='Enter your username here...'/>
      </label>
      <br/>
      <br/>
      <br/>
      <br/>
      <h1>Password:</h1>
      <input type='password' placeholder='Enter your password here...'/>
    </div>
  );
}

export default LoginPage;
